d19DtyCFYcPqLkRlhfvf/0VJfQPL3/8PT04dt3dVOsd09ff+A6nzLgD8qP8yJojK630t5XLpc7lJbBde//AYudP/z14BBPAAAAAElFTkSuQmCC';

const bird=new Image();bird.src='https://i.postimg.cc/pr7SsR9W/IMG-5534-2.png';
const enemyImg=new Image();enemyImg.src='https://i.postimg.cc/CKxxysPR/IMG-5535.png';

let player={x:140,y:400,w:80,h:80,vy:0,g:0.65,power:-12,fast:-15,trail:[],last:0};
let pipes=[],enemies=[],coins=[],particles=[];
let score=0,high=localStorage.getItem('fe_high')||0,mul=1;
let over=false,started=false,startDelay=60;
let baseSpeed=4.2,maxSpeed=9;
let pipeTimer=0,coinTimer=0;
let bgOffsetX=0;
let bgVerticalOffset=600;        // tweak this number only if you want it slightly lower/higher
const bgSpeedX=1.6;
let time=0;

// === INPUT ===
function flap(e){
  if(e)e.preventDefault();
  if(!started&&startDelay<=0){started=true;}
  if(over){reset();return;}
  const now=Date.now();
  player.vy=(now-player.last<180)?player.fast:player.power;
  player.last=now;
  emitParticles('flap');   // colorful firework bubbles are back!
}
addEventListener('keydown',e=>e.code==='Space'&&flap(e));
canvas.addEventListener('touchstart',flap,{passive:false});
canvas.addEventListener('mousedown',flap);

function reset(){
  score=0;mul=1;pipes=[];enemies=[];coins=[];particles=[];player.trail=[];
  player.y=H/2-40;player.vy=0;over=false;started=false;startDelay=60;
  bgOffsetX=0;pipeTimer=0;coinTimer=0;
}

// === SPAWNERS ===
function spawnPipe(){
  const prog=Math.min(score/80,1);
  const gap=290-prog*150;
  const y=70+Math.random()*(H-gap-140);
  const isRed=Math.random()<0.5;
  pipes.push({x:W,gapY:y,gapSize:gap,passed:false,t:time+Math.random()*200,isRed});
}
function spawnCoin(){coins.push({x:W,y:100+Math.random()*(H-200),r:18,sp:0,bob:Math.random()*6});}
function spawnEnemy(){if(score<6)return;enemies.push({x:W,y:100+Math.random()*(H-200),s:baseSpeed+3+Math.random()*3,bob:Math.random()*6});}

// === PARTICLES (firework bubbles on flap) ===
function emitParticles(type){
  const num=type==='crash'?60:22;
  const color=type==='crash'?'#ff5566':type==='coin'?'#ffd700':'#00ffdd';
  for(let i=0;i<num;i++){
    particles.push({
      x:player.x+40+(Math.random()-0.5)*40,
      y:player.y+40+(Math.random()-0.5)*40,
      vx:(Math.random()-0.5)*(type==='crash'?18:9),
      vy:(Math.random()-0.5)*(type==='crash'?16:7),
      life:1,
      decay:type==='crash'?0.04:0.025,
      grav:type==='flap'?0:0.35,
      color,
      size:type==='crash'?8:6
    });
  }
}

// === MAIN LOOP ===
function loop(){
  ctx.clearRect(0,0,W,H);time++;

  // Background (seamless + lowered)
  if(bg.complete){
    const tw=bg.naturalWidth;
    bgOffsetX=(bgOffsetX+bgSpeedX)%tw;
    ctx.save();
    for(let dx=-1;dx<=1;dx++){
      for(let dy=-1;dy<=1;dy++){
        ctx.drawImage(bg,-bgOffsetX+dx*tw,bgVerticalOffset+dy*bg.naturalHeight);
      }
    }
    ctx.restore();
  }

  // Physics
  if(startDelay>0){startDelay--;player.vy*=0.92;}
  else if(started){player.vy+=player.g;player.y+=player.vy;}
  if(player.y<0){player.y=0;player.vy=0;}
  if(player.y+player.h>H&&started){emitParticles('crash');over=true;}

  const prog=Math.min(score/85,1);
  const speed=baseSpeed+(maxSpeed-baseSpeed)*prog;
  mul=1+Math.floor(prog*3);

  if(started){
    if(++pipeTimer>85-prog*40){spawnPipe();pipeTimer=0;}
    if(++coinTimer>220-prog*60){spawnCoin();coinTimer=0;}
    if(Math.random()<0.006+prog*0.015)spawnEnemy();
  }

  // Trail
  player.trail.push({x:player.x+40,y:player.y+40});
  if(player.trail.length>12)player.trail.shift();
  for(let i=0;i<player.trail.length;i++){
    const a=i/player.trail.length*0.45;
    ctx.save();ctx.globalAlpha=a;
    ctx.fillStyle='#00ffff';ctx.shadowColor='#00ffff';ctx.shadowBlur=18*a;
    ctx.beginPath();ctx.arc(player.trail[i].x,player.trail[i].y,13*a,0,Math.PI*2);ctx.fill();
    ctx.restore();
  }

  // === PIPES / CANDLES (no wicks, dynamic color) ===
  for(let i=pipes.length-1;i>=0;i--){
    const p=pipes[i];p.x-=speed;
    const pulse=55+Math.sin(time*0.08+p.t)*35;
    const top=p.gapY-pulse;
    const bottom=p.gapY+p.gapSize+pulse;

    // Collision & scoring
    if(player.x+player.w>p.x&&player.x<p.x+36&&(player.y<top||player.y+player.h>bottom)){
      emitParticles('crash');over=true;
    }
    if(!p.passed&&player.x>p.x+36){
      score+=mul;
      if(score>high){high=score;localStorage.setItem('fe_high',high);}
      p.passed=true;
    }

    // Dynamic color: green when growing, red when shrinking
    const growing=Math.sin(time*0.06+p.t)>0;
    ctx.fillStyle=growing?(p.isRed?'#ff4444':'#00ff88'):(p.isRed?'#ff8888':'#88ff88');
    ctx.shadowColor=ctx.fillStyle;ctx.shadowBlur=12;
    ctx.fillRect(p.x,0,36,top);
    ctx.fillRect(p.x,bottom,36,H-bottom);
    ctx.shadowBlur=0;

    if(p.x+36<-80)pipes.splice(i,1);
  }

  // === COINS ===
  for(let i=coins.length-1;i>=0;i--){
    const c=coins[i];c.x-=speed;c.sp+=0.25;c.bob+=0.11;c.y+=Math.sin(c.bob)*0.9;
    const dx=player.x+40-c.x,dy=player.y+40-c.y;
    if(Math.hypot(dx,dy)<48){
      score+=10*mul;emitParticles('coin');coins.splice(i,1);continue;
    }
    ctx.save();ctx.translate(c.x,c.y);ctx.rotate(c.sp);
    ctx.fillStyle='#ffd700';ctx.shadowColor='#ffaa00';ctx.shadowBlur=25;
    ctx.beginPath();ctx.arc(0,0,c.r,0,Math.PI*2);ctx.fill();
    ctx.restore();
    if(c.x<-50)coins.splice(i,1);
  }

  // === ENEMIES ===
  for(let i=enemies.length-1;i>=0;i--){
    const e=enemies[i];e.x-=e.s;e.bob+=0.16;e.y+=Math.sin(e.bob)*1.4;
    if(enemyImg.complete)ctx.drawImage(enemyImg,e.x,e.y,56,56);
    const dx=player.x+40-(e.x+28),dy=player.y+40-(e.y+28);
    if(Math.hypot(dx,dy)<62){emitParticles('crash');over=true;}
    if(e.x<-100)enemies.splice(i,1);
  }

  // === PARTICLES ===
  for(let i=particles.length-1;i>=0;i--){
    const p=particles[i];
    p.x+=p.vx;p.y+=p.vy;p.vy+=p.grav;
    p.life-=p.decay;
    if(p.life<=0){particles.splice(i,1);continue;}
    ctx.save();ctx.globalAlpha=p.life;
    ctx.fillStyle=p.color;ctx.shadowColor=p.color;ctx.shadowBlur=25*p.life;
    ctx.beginPath();ctx.arc(p.x,p.y,p.size*p.life,0,Math.PI*2);ctx.fill();
    ctx.restore();
  }

  // === PLAYER ===
  ctx.save();ctx.translate(player.x+40,player.y+40);
  ctx.rotate(Math.max(-0.45,Math.min(0.85,player.vy*0.08)));
  if(bird.complete)ctx.drawImage(bird,-40,-40,80,80);
  ctx.restore();

  // === GAME END WHEN BACKGROUND REACHES THE END ===
  if(bg.complete && bgOffsetX > bg.naturalWidth - W - 50){
    over=true;
  }

  // === UI ===
  ctx.fillStyle='#ffffff';ctx.font='bold 42px Arial';ctx.textAlign='center';
  ctx.fillText(score,W/2,70);
  ctx.font='bold 28px Arial';ctx.fillStyle=mul>1?'#ffd700':'#00ffcc';
  ctx.fillText(`×${mul}`,W/2,110);
  ctx.font='22px Arial';ctx.fillStyle='#88ffff';
  ctx.fillText(`BEST ${high}`,W/2,145);

  if(startDelay>0){
    ctx.fillStyle='rgba(0,20,60,0.92)';ctx.fillRect(80,200,W-160,320);
    ctx.fillStyle='#00ffff';ctx.font='bold 56px Arial';
    ctx.fillText('FLAPPY ETHEREUM',W/2,320);
    ctx.font='36px Arial';ctx.fillText('Tap or Space to fly',W/2,390);
  }
  if(over){
    ctx.fillStyle='rgba(0,0,0,0.9)';ctx.fillRect(80,180,W-160,360);
    ctx.fillStyle='#ff3355';ctx.font='bold 72px Arial';
    ctx.fillText('FINISHED!',W/2,300);
    ctx.fillStyle='#fff';ctx.font='44px Arial';
    ctx.fillText(`Score: ${score}`,W/2,360);
    ctx.fillStyle=score===high?'#ffd700':'#88ffff';
    ctx.fillText(`Best: ${high}`,W/2,410);
    ctx.fillStyle='#ccc';ctx.font='34px Arial';
    ctx.fillText('Tap to play again',W/2,480);
  }

  requestAnimationFrame(loop);
}
loop();
</script>
